import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import { Cell } from "./components";

class App extends Component {
  state = {
    puzzle: []
  };

  componentWillMount() {
    this.populateBoard();
  }

  getPuzzle() {
    fetch("http://localhost:3000/puzzles", {
      method: "GET",
      headers: {
        "Content-Type": "application/json"
      }
    })
      .then(response => response.json())
      .then(responseJson => {
        this.setState({
          puzzle: responseJson
        });

        console.log(responseJson);
      })
      .catch(error => {
        console.error(error);
      });
  }

  renderGameBoard() {
    for (let j = 0; j < 9; j++) {
      for (let i = 0; i < this.state.board[j].length; i++) {
        return (
          <div>
            {console.log("hello")}
            {this.state.board[i].map(cell => (
              <Cell key={cell} />
            ))}
            ;
          </div>
        );
      }
    }
  }

  render() {
    return <div className="cellView">{this.renderGameBoard()}</div>;
  }
}

export default App;
